function process_data(data) {
  var answers = [];
  var clay_count = 0;
  var hard_count = 0;

  data.forEach(function(row, index) {
    if (row['surface'] == 'clay') {
      clay_count += 1;
    } else if (row['surface'] == 'hard') {
      hard_count += 1;
    }

    if (index < 2) {
      answers.push({answer: "FALSE", relevant_cells: []});
    } else {
      var score_parts = row.score.split(',').map(function(part) { return part.trim().split(' '); });

      var clay_wins = 0;
      var hard_wins = 0;

      for (var i = 0; i < score_parts.length; i++) {
        if (score_parts[i][1] === '2') {
          clay_wins += 1;
        } else if (score_parts[i][1] === '2') {
          hard_wins += 1;
        }
      }

      var clay_win_rate = clay_wins / (clay_count - clay_wins);
      var hard_win_rate = hard_wins / (hard_count - hard_wins);

      if (Math.abs(clay_win_rate - hard_win_rate) < Number.EPSILON) {
        answers.push({answer: "TRUE", relevant_cells: []});
      } else {
        answers.push({answer: "FALSE", relevant_cells: [{row_index: index, column_name: 'surface'}, {row_index: index, column_name: 'opponent'}]});
      }
    }
  });

  return JSON.stringify(answers);
}

